"/// 警告 ///\n"
"该参数涉及FAA放卡核心原理\n"
"请您耐心阅读提示, 完全理解再进行调整\n"
"\n"
"FAA放卡核心原理简述:\n"
"* FAA将按战斗方案中的优先级使用卡片\n"
"* 编辑器左侧列表从上到下,即为优先级从高到低\n"
